import * as THREE from 'three';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls.js';


const cubeVertexShader = `
out vec2 vUv;
void main() {
	vUv = uv;
	vec3 newPosition = position;
	gl_Position = projectionMatrix * modelViewMatrix * vec4(newPosition, 1.0);
}
`;

const cubeFragmentShader = `
uniform vec2 aMin;
uniform vec2 aMax;
in vec2 vUv;
uniform sampler2D texture1;
uniform sampler2D texture2;
void main() {
	vec2 position =  vUv;
	if (vUv.x<aMin.x || vUv.x>aMax.x || vUv.y<aMin.y || vUv.y>aMax.y) {
		gl_FragColor = texture( texture2, position );
	} else {
		position -= aMin;
		position.x /= aMax.x - aMin.x;
		position.y /= aMax.y - aMin.y;

		gl_FragColor = texture( texture1, position );
	}

}
`;

const img = document.createElement( 'img' );
document.body.appendChild( img );
img.id = 't2';
img.style = 'display: none;';
img.src = 'data:image/jpg;base64,';


let camera, scene, renderer, controls, mesh, helper;

let image = document.createElement( 'img' );
let texture = new THREE.Texture( image );

let texture2 = new THREE.Texture( document.getElementById( 't2' ) );
texture2.needsUpdate = true;

const MeshAlignMaterial = function ( t, minX, minY, maxX, maxY ) {
	let uniforms = {
		aMin: { type: 'v2', value: new THREE.Vector2( minX, minY ) },
		aMax: { type: 'v2', value: new THREE.Vector2( maxX, maxY ) },
		texture: { type: 't', value: t },
		texture2: { type: 't', value: texture2 }
	};

	return new THREE.ShaderMaterial( {
		side: THREE.DoubleSide,
		uniforms: uniforms,
		vertexShader: cubeVertexShader,
		fragmentShader: cubeFragmentShader
	} );

};

init();
animate();

function init() {
	renderer = new THREE.WebGLRenderer();
	renderer.setSize( window.innerWidth, window.innerHeight );
	document.body.appendChild( renderer.domElement );
	scene = new THREE.Scene();
	camera = new THREE.PerspectiveCamera( 40, window.innerWidth / window.innerHeight, 1, 1000 );
	camera.position.set( 50, 50, 150 );
	scene.add( camera ); // since light is child of camera

	controls = new OrbitControls( camera, renderer.domElement );
	controls.minDistance = 75;
	controls.maxDistance = 200;
	controls.noPan = true;

	scene.add( new THREE.AmbientLight( 0x222222 ) );

	let light = new THREE.PointLight( 0xffffff, 1 );
	camera.add( light );

	let axisHelper = new THREE.AxesHelper( 50 );
	scene.add( axisHelper );

	let materials = [];
	materials.push( MeshAlignMaterial( texture, 0, 0, 0.25, 0.25 ) );
	materials.push( MeshAlignMaterial( texture, 0.75, 0.75, 1, 1 ) );
	materials.push( MeshAlignMaterial( texture, 0.25, 0.25, 0.75, 0.75 ) );
	materials.push( MeshAlignMaterial( texture, 0, 0, 1, 1 ) );
	materials.push( MeshAlignMaterial( texture, 0, 0, 0.5, 0.5 ) );
	materials.push( MeshAlignMaterial( texture, 0, 0.1, 0.1, 0.5 ) );

	mesh = new THREE.Mesh( new THREE.BoxGeometry( 50, 50, 50 ), materials );
	helper = new THREE.Mesh( new THREE.BoxGeometry( 50, 50, 50 ), new THREE.MeshBasicMaterial( { color: 0xffffff, wireframe: true } ) );
	helper.add( mesh );
	scene.add( helper );
}

function animate() {
	requestAnimationFrame( animate );
	controls.update();
	render();
}

function render() {
	renderer.render( scene, camera );
}

image.addEventListener( 'load', function () {
	texture.needsUpdate = true;
} );

image.src = 'data:image/png;base64,';


